import React, { Component } from "react";

import Countdown from "./Countdown";
import './index.css'
class App extends Component {
  render() {
    return (
      <div className="App">
        <div className="App-title">Timers Demo</div>
        <div className="Timers">

          <Countdown />
        </div>
      </div>
    );
  }
}

export default App;
